import react, { useState } from 'react';
import './App.css';

function App() {

  const [words, setWords] = useState({
    english: '',
    korean: ''
  });

  const onChange = e => {
    console.log(e.target.value);
  }

  const onSave = () => {
    if(words[english] === '') {
      console.log('영어가 빠졌어요!');
    }
    alert('등록되었습니다!');
  }

  return (
    <div className="app">
      <div className="container">
        <input type="text" name="english" placeholder="영단어" onChange={onChange}/>
        <input type="text" name="korean" placeholder="뜻" onChange={onChange}/>
        <button onClick={onSave}>등록</button>
        <button>시험보기</button>
      </div>
    </div>
  );
}

export default App;
